webpackJsonp([0x79fd44571d29],{604:function(e,a){e.exports={data:{markdownRemark:{html:'<h3>Signal &#x26; Impact</h3>\n<p>We introduce Signal and Impact so that there can be a more granular understanding of hacker performance. Read our <a href="https://hackerone.com/blog/introducing-signal-and-impact">blog post</a> or check out our <a href="https://docs.hackerone.com/hackers/signal-and-impact.html">doc</a> to learn more.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/dec_2015_signal_impact-d2b41dc961635a986394f69b3f89a703-ed8c2.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 95.43230016313214%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="dec_2015_signal_impact"\n        title=""\n        src="/static/dec_2015_signal_impact-d2b41dc961635a986394f69b3f89a703-2f183.png"\n        srcset="/static/dec_2015_signal_impact-d2b41dc961635a986394f69b3f89a703-67829.png 125w,\n/static/dec_2015_signal_impact-d2b41dc961635a986394f69b3f89a703-5c59f.png 250w,\n/static/dec_2015_signal_impact-d2b41dc961635a986394f69b3f89a703-2f183.png 500w,\n/static/dec_2015_signal_impact-d2b41dc961635a986394f69b3f89a703-ed8c2.png 613w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>New Default Views</h3>\n<p>We add these new default views to the inbox to better organize reports:</p>\n<ul>\n<li>Triaged</li>\n<li>Assigned to me</li>\n<li>Pending disclosure</li>\n<li>Pending bounty\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/dec_2015_default_views-72de350f524857471e4718d07e002d20-adb8f.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 26.057030481809246%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="dec_2015_new_default_views"\n        title=""\n        src="/static/dec_2015_default_views-72de350f524857471e4718d07e002d20-2f183.png"\n        srcset="/static/dec_2015_default_views-72de350f524857471e4718d07e002d20-67829.png 125w,\n/static/dec_2015_default_views-72de350f524857471e4718d07e002d20-5c59f.png 250w,\n/static/dec_2015_default_views-72de350f524857471e4718d07e002d20-2f183.png 500w,\n/static/dec_2015_default_views-72de350f524857471e4718d07e002d20-c93e8.png 750w,\n/static/dec_2015_default_views-72de350f524857471e4718d07e002d20-4e628.png 1000w,\n/static/dec_2015_default_views-72de350f524857471e4718d07e002d20-adb8f.png 1017w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </li>\n</ul>\n<h3>Protective Disclosure</h3>\n<p>If the response team has evidence of active exploitation or imminent public harm, they can immediately provide remediation details to the public so that programs can take protective action.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/dec_2015_protective_disclosure-30caa3bcb6fe5192c154d34e41bab97b-8f674.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 47.59284731774415%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="dec_2015_protective_disclosure"\n        title=""\n        src="/static/dec_2015_protective_disclosure-30caa3bcb6fe5192c154d34e41bab97b-2f183.png"\n        srcset="/static/dec_2015_protective_disclosure-30caa3bcb6fe5192c154d34e41bab97b-67829.png 125w,\n/static/dec_2015_protective_disclosure-30caa3bcb6fe5192c154d34e41bab97b-5c59f.png 250w,\n/static/dec_2015_protective_disclosure-30caa3bcb6fe5192c154d34e41bab97b-2f183.png 500w,\n/static/dec_2015_protective_disclosure-30caa3bcb6fe5192c154d34e41bab97b-c93e8.png 750w,\n/static/dec_2015_protective_disclosure-30caa3bcb6fe5192c154d34e41bab97b-4e628.png 1000w,\n/static/dec_2015_protective_disclosure-30caa3bcb6fe5192c154d34e41bab97b-8f674.png 1454w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Preview Image Attachments</h3>\n<p>Programs and hackers can now preview image attachments on the report form.</p>',frontmatter:{path:"/changelog/2015/december",title:"December 2015"}}},pathContext:{}}}});
